import React, { Component } from 'react';

class ToDoList extends Component {

    constructor(){
        super()
        this.state ={
            myList : [],
          }
    }
   
    componentDidMount(){

        this.setState({myList:['Shoping', 'Reading'] })
    }

    render() {
      
        return (
<div>
    <h1> my list</h1>
<ul>
            {this.state.myList.map(function(name, index){
                return <li key={ index }>{name}</li>;
              })}
        </ul>
</div>
        
        );
    }
}

export default ToDoList;
